import React, { Component } from 'react';
import { Route, Switch } from 'react-router-dom';
import CreateMyCompany from './component/company/CreateMyCompany'
// import Menu from './component/Menu'


class App extends Component {
  render() {
    return (
      <div>
         <Switch>
            {/* <Route exact patch='/menu' component = { Menu } /> */}
            <Route path="/createmycompany" component = { CreateMyCompany } />
            <Route path="/modifyAssoprofil/:id" component={ModifyAssoprofil} />
            <Route exact path="/Assoprofil" component={Assoprofil} />

          </Switch>
      </div>
    );
  }
}

export default App;
